window.bookSummaryJSON = "<p><b>Ellie knew it was a bad idea.</b></p> <p>She took the job to prove a point—that she's more than an Omega haunted by her past. That she can find the good in the worst monsters the world has to offer.</p> <p>But by the time she's face-to-face with the deadliest Alpha, it's too late. He's more beast than man and too intelligent to be trapped behind bars for long.</p> <p>She's become his new obsession. And if he tries to catch her…</p> <p>She just might let him.</p> <p>Alpha Inmate <i>is a dark love story with a twisted Alpha and a stubborn Omega too smart for her own good. HEA guaranteed, even if they struggle to get there. This book contains sensitive content that may be triggering to some listeners.</i></p>"; 
